import React from 'react'
import { Link, useLocation } from 'react-router-dom'
import Style from "./NavBar.module.css"

const NavBar = () => {
    const location = useLocation();
    const {pathname} = location;
    const splitLocation = pathname.split("/");

    return (
        <div className={Style.navBar_container}>
            <div className={Style.nav}>
                <Link to="/home" className={splitLocation[1] === "home" ? Style.menuItem : ""}> Home </Link>
                <Link to="/aboutMe" className="menuItem"> About me </Link>
                <Link to="/portafolio" className="menuItem"> Portafolio </Link>
                <Link to="/contactMe" className="menuItem"> Contact me </Link>
            </div>
        </div>
    )
}

export default NavBar
